import ProjectList from '../project/ProjectList';
import {firebase} from './firebaseConfig';
class DashBoard extends Component {
    render(){
        return (
            <div className="dashboard container">
                <div className="row">   
                    <div className="col s12 m6">
                        <ProjectList />
                    </div>

                </div>
            </div>
        )
    }
}

export default DashBoard;
